import React from "react";
import { useSelector } from "react-redux";
import { useParams } from "react-router-dom";
import TvHeader from "./TvHeader";
import CastPeople from "./cast/CastPeople";
import CrewPeople from "./cast/CrewPeople";

const FullCast = () => {
  const { id } = useParams();
  const fullTvCast = useSelector((state) => state.series.tvActors.data);

  return (
    <div className="flex gap-5 flex-col pl-10 pr-10">
      <TvHeader />
      <CastPeople />
      <CrewPeople />
    </div>
  );
};

export default FullCast;
